Rect frameDiff2ROI_HSV(const Mat& back, const Mat& fore, int color)
{
		//SPDLOG_SINKS_DEBUG("..................frameDiff2ROI_HSV.....................");
		Mat b, f, mask, mask_hsv, hsv_img_mask;
		Rect roi;
		back.copyTo(b);
		fore.copyTo(f);
		int v = 88;

		//SPDLOG_SINKS_DEBUG("Frame difference algorithm starts.");
		cv::subtract(f, b, mask);
		imshow("hsv_mask", mask);

		const float* hsv = cfg.hsvColor(color);

		cv::cvtColor(mask, mask_hsv, COLOR_BGR2HSV);

		cv::inRange(mask_hsv, Scalar(hsv[eHmin], hsv[eSmin], hsv[eVmin]+v), Scalar(hsv[eHmax], 255, 255), hsv_img_mask);

		if (color == RED)
		{
			Mat hsv_img_mask_r;

			cv::inRange(mask_hsv, Scalar(hsv[eHmin2], hsv[eSmin], hsv[eVmin]+v), Scalar(hsv[eHmax2], 255, 255), hsv_img_mask_r);
			hsv_img_mask += hsv_img_mask_r;
		}

		cv::adaptiveThreshold(hsv_img_mask, hsv_img_mask, 255, ADAPTIVE_THRESH_GAUSSIAN_C, THRESH_BINARY, 101, -9);

		cv::medianBlur(hsv_img_mask, hsv_img_mask, 3);

		cv::GaussianBlur(hsv_img_mask, hsv_img_mask, cv::Size(3, 3), 0);
		cv::imshow("hsv_img_mask", hsv_img_mask);

		//存储边缘
		vector<vector<Point> > contours;
		vector<Rect> boundRect;
		vector<Vec4i> hierarchy;
		Mat result = Mat::zeros(f.size(), f.type());
		cv::findContours(hsv_img_mask, contours, hierarchy, RETR_EXTERNAL, CHAIN_APPROX_NONE, Point(0, 0));//查找最顶层轮廓
		//SPDLOG_SINKS_DEBUG("Find {} Contours", contours.size());

		for (int i = 0; i < contours.size(); ++i)
		{
			// 生成最小包围矩形
			vector<Point> contours_poly;
			approxPolyDP(Mat(contours[i]), contours_poly, 3, true);
			Rect r = boundingRect(contours_poly);

			// 轮廓面积校验
			if (r.area() < cfg.minContoursArea())
				continue;
			//SPDLOG_SINKS_DEBUG("{}th rect.area:{}", i, r.area());

			roi |= r;

			drawContours(result, contours, i, Scalar(0, 255, 255), 1);
		}
		
		rectangle(result, roi, Scalar(255, 255, 0), 1);
		cv::imshow("hsv_contours", result);

		return roi;

}

void checkROIContoursColor(Mat frame, Mat mask, Mat result, int currentColor, vector<vector<Point> >& contours, vector<Rect>& boundRect)
{
	for (int index = 0; index < contours.size(); index++)
	{
		// 生成最小包围矩形
		vector<Point> contours_poly;
		approxPolyDP(Mat(contours[index]), contours_poly, 3, true);
		Rect rect = boundingRect(contours_poly);

		//SPDLOG_SINKS_DEBUG("{}th rect.area:{}", index, rect.area());
		// 轮廓面积校验
		if (rect.area() < 100)
			continue;

		// 校验轮廓颜色
		Mat mask_cell = mask(rect).clone();
		Mat frame_cell = frame(rect).clone();
		//cv::imshow("frame_cell", frame_cell);
		//waitKey();

		// 计算各通道均值
		bool colorCorrect = false;
		Scalar means;
		means = mean(frame_cell, mask_cell);

		double b = means[0];
		double g = means[1];
		double r = means[2];
		double p = 0.0;
		if (currentColor == BLUE)
		{
			p = b / (b + g + r);
			// 亮bule时，b通道要占多数，其他情况一律抹掉该轮廓
			if (b > 50 && b > g && b > r && p > 0.45) {
				colorCorrect = true;
			}
			else if ((1.0 - p) < 0.02) {
				// b 通道独占80%，即便是亮度很低的情况下也近乎纯蓝色
				colorCorrect = true;
			}
		}
		else if (currentColor == GREEN)
		{
			p = g / (b + g + r);
			if (g > 50 && g > b && g > r && p > 0.45) {
				colorCorrect = true;
			}
			else if ((1.0 - p) < 0.02) {
				colorCorrect = true;
			}
		}
		else if (currentColor == RED)
		{
			p = r / (b + g + r);
			if (r > 50 && r > b && r > g && p > 0.45) {
				colorCorrect = true;
			}
			else if ((1.0 - p) < 0.02) {
				colorCorrect = true;
			}
		}

		if (colorCorrect)
		{
			boundRect.push_back(rect);
			// 绘制各自小轮廓
			Scalar color = Scalar(0, 255, 255);
			drawContours(result, contours, index, color, 1);

			//SPDLOG_SINKS_DEBUG("CheckContoursColor {}th ({},{}) width:{} height:{} area:{}; Mean b:{}, g:{}, r:{}, p:{} --> yes", index, rect.x, rect.y, rect.width, rect.height, rect.area(), b, g, r, p);
		}
		else
		{
			//SPDLOG_SINKS_DEBUG("CheckContoursColor {}th ({},{}) width:{} height:{} area:{}; Mean b:{}, g:{}, r:{}, p:{} --> no", index, rect.x, rect.y, rect.width, rect.height, rect.area(), b, g, r, p);
			rect = Rect();
		}
	}
}

Rect frameDiff2ROI_BGR(const Mat& back, const Mat& fore, int color)
{
	//SPDLOG_SINKS_DEBUG("..................frameDiff2ROI_BGR.....................");
	Mat b, f, mask;
	Rect roi;
	back.copyTo(b);
	fore.copyTo(f);

	std::vector<Mat> frame_bgrs, back_bgrs;
	Mat frame_gray, back_gray;
	if (color == WHITE) {
		cv::cvtColor(f, frame_gray, COLOR_BGR2GRAY);
		cv::cvtColor(b, back_gray, COLOR_BGR2GRAY);
	}
	else
	{
		split(f, frame_bgrs);
		split(b, back_bgrs);
		frame_gray = frame_bgrs[color];
		back_gray = back_bgrs[color];
	}

	cv::subtract(frame_gray, back_gray, mask);
	threshold(mask, mask, 100, 255, THRESH_TOZERO);
	
	cv::adaptiveThreshold(mask, mask, 255, ADAPTIVE_THRESH_GAUSSIAN_C, THRESH_BINARY, cfg.thresoldBlockSize(), cfg.thresoldC());

	//形态学处理
	Mat kernel = getStructuringElement(MORPH_CROSS, Size(3, 3));
	cv::morphologyEx(mask, mask, MORPH_OPEN, kernel);

	cv::medianBlur(mask, mask, 3);

	//imshow("bgr_mask", mask);

	//存储边缘
	vector<vector<Point> > contours;
	vector<Rect> boundRect;
	vector<Vec4i> hierarchy;
	Mat result = Mat::zeros(f.size(), f.type());
	findContours(mask, contours, hierarchy, RETR_EXTERNAL, CHAIN_APPROX_NONE, Point(0, 0));//查找最顶层轮廓
	//SPDLOG_SINKS_DEBUG("Find {} Contours", contours.size());

	checkROIContoursColor(f, mask, result, color, contours, boundRect);
	//imshow("result", result);

	std::sort(boundRect.begin(), boundRect.end(), [](cv::Rect& l, cv::Rect& r) { return l.area() > r.area(); });
	for (int i = 0; i < boundRect.size(); ++i)
	{
		roi |= boundRect[i];
	}
	return roi;
}

void autoCaptureROI2(std::string& path)
{
	// B-G-R三色来圈取灯带ROI
	// 可能存在的问题是，若其中一个颜色(如 Green) 只抓到了一半的ROI， 进行合并后
	// Rect 相交 取最小区域，最后结果就只有半个ROI
	Mat back, fore;
	Rect roi_hsv[BGR];
	Rect roi_bgr[BGR];
	for (int color = BLUE; color < WHITE; ++color)
	{
		char name[MAX_PATH] = { 0 };
		sprintf_s(name, MAX_PATH, "\\roi_%02d_back.png", color);

		back = cv::imread(path+name);
		if (back.empty()) break;

		sprintf_s(name, MAX_PATH, "\\roi_%02d_fore.png", color);

		fore = cv::imread(path + name);
		if (fore.empty()) break;

		roi_hsv[color] = frameDiff2ROI_HSV(back, fore, color);

		roi_bgr[color] = frameDiff2ROI_BGR(back, fore, color);

	}

	Rect r_hsv = (roi_hsv[BLUE] | roi_hsv[GREEN]) & roi_hsv[RED];

	Rect r_bgr = (roi_bgr[BLUE] | roi_bgr[GREEN]) & roi_bgr[RED];

	if (!fore.empty())
	{
		rectangle(fore, r_hsv, Scalar(255, 255, 0), 1);
		rectangle(fore, roi_hsv[BLUE], Scalar(255, 0, 0), 1);
		rectangle(fore, roi_hsv[GREEN], Scalar(0, 255, 0), 1);
		rectangle(fore, roi_hsv[RED], Scalar(0, 0, 255), 1);
		rectangle(fore, r_bgr, Scalar(255, 255, 255), 1);

		cv::putText(fore, path.c_str(), Point(0, (fore.rows / 8)), FONT_HERSHEY_SIMPLEX, 0.5, Scalar(0, 255, 255));
		cv::imshow("result", fore);
	}
	
	Rect r_mixed = r_hsv & r_bgr;
	float r_mixed_area = (float)r_mixed.area();
	float r_hsv_area = (float)r_hsv.area();
	float r_bgr_area = (float)r_bgr.area();
	float percent_hsv = r_hsv.area() == 0 ? 0 : r_mixed_area / r_hsv_area;
	float percent_bgr = r_bgr.area() == 0 ? 0 : r_mixed_area / r_bgr_area;
	g_filehandle << path.c_str()
		<< "," << r_mixed.x << "," << r_mixed.y << "," << r_mixed.width << "," << r_mixed.height << "," << r_mixed.area()
		<< "," << percent_hsv << "," << percent_bgr
		<< std::endl;

	if (true)
	{
		while (true)
		{
			if (0x1b == cv::waitKey(33))
				break;
		}
	}
	else 
	{
		cv::waitKey(33);
	}

}

Rect findFrameContours_HSV(const Mat& b, const Mat& f, int currentColor, int currentIndex)
{
	//SPDLOG_SINKS_DEBUG("****************findFrameContours_HSV****************");
	//SPDLOG_SINKS_DEBUG("CurrentColor = {}, CurrentIndex = {}", currentColor, currentIndex);

	Mat frame, back, mask, mask_hsv;
	Mat hsv_img_mask;
	frame = f.clone();
	back = b.clone();

	if (frame.empty() || back.empty())
	{
		return Rect();
	}

	//cv::imshow("hsv_fore", frame);
	//cv::imshow("hsv_back", back);
	//waitKey(1);
	cv::subtract(frame, back, mask);

	const float* hsv = cfg.hsvColor(currentColor);

	cv::cvtColor(mask, mask_hsv, COLOR_BGR2HSV);

	cv::inRange(mask_hsv, Scalar(hsv[eHmin], hsv[eSmin], hsv[eVmin]), Scalar(hsv[eHmax], 255, 255), hsv_img_mask);

	if (currentColor == RED)
	{
		Mat hsv_img_mask_r;

		cv::inRange(mask_hsv, Scalar(hsv[eHmin2], hsv[eSmin], hsv[eVmin]), Scalar(hsv[eHmax2], 255, 255), hsv_img_mask_r);
		hsv_img_mask += hsv_img_mask_r;
	}

	cv::adaptiveThreshold(hsv_img_mask, hsv_img_mask, 255, ADAPTIVE_THRESH_GAUSSIAN_C, THRESH_BINARY, 101, -9);

	cv::medianBlur(hsv_img_mask, hsv_img_mask, 3);

	cv::GaussianBlur(hsv_img_mask, hsv_img_mask, cv::Size(3, 3), 0);

	//cv::imshow("mask_hsv", hsv_img_mask);

	//存储边缘
	vector<vector<Point> > contours;
	vector<Rect> boundRect;
	vector<Vec4i> hierarchy;
	Mat result = Mat::zeros(frame.size(), frame.type());
	cv::findContours(hsv_img_mask, contours, hierarchy, RETR_EXTERNAL, CHAIN_APPROX_NONE, Point(0, 0));//查找最顶层轮廓
	//SPDLOG_SINKS_DEBUG("Find {} Contours", contours.size());

	Rect rect;
	for (int i = 0; i < contours.size(); ++i)
	{
		// 生成最小包围矩形
		vector<Point> contours_poly;
		approxPolyDP(Mat(contours[i]), contours_poly, 3, true);
		Rect r = boundingRect(contours_poly);

		//SPDLOG_SINKS_DEBUG("{}th rect.area:{}", i, r.area());
		// 轮廓面积校验
		if (r.area() < cfg.minContoursArea())
			continue;

		rect |= r;

		drawContours(result, contours, i, Scalar(0, 255, 255), 1);
	}
	
	return ((rect.area() > cfg.ledContoursArea()) ? rect : Rect());
}

int min_distance_of_rectangles(const Rect& rect1, const Rect& rect2)
{
	int min_dist;

	//首先计算两个矩形中心点
	Point C1, C2;
	C1.x = rect1.x + (rect1.width / 2);
	C1.y = rect1.y + (rect1.height / 2);
	C2.x = rect2.x + (rect2.width / 2);
	C2.y = rect2.y + (rect2.height / 2);

	// 分别计算两矩形中心点在X轴和Y轴方向的距离
	int Dx, Dy;
	Dx = abs(C2.x - C1.x);
	Dy = abs(C2.y - C1.y);

	//两矩形不相交，在X轴方向有部分重合的两个矩形，最小距离是上矩形的下边线与下矩形的上边线之间的距离
	if ((Dx < ((rect1.width + rect2.width) / 2)) && (Dy >= ((rect1.height + rect2.height) / 2)))
	{
		min_dist = Dy - ((rect1.height + rect2.height) / 2);
	}

	//两矩形不相交，在Y轴方向有部分重合的两个矩形，最小距离是左矩形的右边线与右矩形的左边线之间的距离
	else if ((Dx >= ((rect1.width + rect2.width) / 2)) && (Dy < ((rect1.height + rect2.height) / 2)))
	{
		min_dist = Dx - ((rect1.width + rect2.width) / 2);
	}

	//两矩形不相交，在X轴和Y轴方向无重合的两个矩形，最小距离是距离最近的两个顶点之间的距离，
	// 利用勾股定理，很容易算出这一距离
	else if ((Dx >= ((rect1.width + rect2.width) / 2)) && (Dy >= ((rect1.height + rect2.height) / 2)))
	{
		int delta_x = Dx - ((rect1.width + rect2.width) / 2);
		int delta_y = Dy - ((rect1.height + rect2.height) / 2);
		min_dist = sqrt(delta_x * delta_x + delta_y * delta_y);
	}

	//两矩形相交，最小距离为负值，返回-1
	else
	{
		min_dist = -1;
	}

	return min_dist;
}

Rect findFrameContours_BGR(const Mat& b, const Mat& f, int currentColor, int currentIndex)
{
	Mat original_frame, frame, mask, back;

	original_frame = f.clone();
	frame = f.clone();
	back = b.clone();

	if (frame.empty() || back.empty())
	{
		return Rect();
	}

	//cv::imshow("original_frame", frame);
	//cv::imshow("background", back);
	
	std::vector<Mat> frame_bgrs, back_bgrs;
	Mat frame_gray, back_gray, temp;
	if (currentColor == WHITE) {
		cv::cvtColor(frame, frame_gray, COLOR_BGR2GRAY);
		cv::cvtColor(back, back_gray, COLOR_BGR2GRAY);
	}
	else
	{
		split(frame, frame_bgrs);
		split(back, back_bgrs);
		frame_gray = frame_bgrs[currentColor];
		back_gray = back_bgrs[currentColor];
	}

	cv::subtract(frame_gray, back_gray, mask);

	cv::adaptiveThreshold(mask, mask, 255, ADAPTIVE_THRESH_GAUSSIAN_C, THRESH_BINARY, cfg.thresoldBlockSize(), cfg.thresoldC());

	//形态学处理
	Mat kernel = getStructuringElement(MORPH_CROSS/*MORPH_RECT*/, Size(3, 3));
	cv::morphologyEx(mask, mask, MORPH_OPEN, kernel);

	cv::medianBlur(mask, mask, 3);
	//cv::imshow("mask", mask);

	vector<vector<Point> > contours;
	vector<Rect> boundRect;
	vector<Vec4i> hierarchy;
	Mat result = Mat::zeros(frame.size(), frame.type());
	findContours(mask, contours, hierarchy, RETR_EXTERNAL, CHAIN_APPROX_NONE, Point(0, 0));//查找最顶层轮廓

	checkROIContoursColor(frame, mask, result, currentColor, contours, boundRect);

	//cv::imshow("contours", result);

	Rect rect;
	for (int i = 0; i < boundRect.size(); i++)
	{
		rect |= boundRect[i];
		drawContours(result, contours, i, Scalar(0, 255, 255), 1);
	}
	
	//cv::imshow("result", original_frame);
	//cv::waitKey(1);

	return ((rect.area() > cfg.ledContoursArea()) ? rect : Rect());
}

void findContours(std::string& path)
{
	Mat back, fore;
	Rect roi_hsv;
	Rect roi_bgr;
	std::string x = path.substr(path.find_last_of("\\")+1);
	
	for (int color = BLUE; color < WHITE; ++color)
	{
		g_filehandle2 << x.c_str() << "," <<color_str[color];
		for (int i = 0; i < 22; ++i)
		{
			char backName[256] = { 0 };
			char originName[256] = { 0 };
			sprintf_s(backName, 256, "%s\\00_%02d%02d_background.png", path.c_str(), color, i);
			sprintf_s(originName, 256, "%s\\00_%02d%02d_original.png", path.c_str(), color, i);

			back = imread(backName);
			fore = imread(originName);
			if (fore.empty() || back.empty())
			{
				break;
			}

			roi_hsv = findFrameContours_HSV(back, fore, color, i);

			roi_bgr = findFrameContours_BGR(back, fore, color, i);

			rectangle(fore, roi_hsv, Scalar(0, 255, 0), 1);
			rectangle(fore, roi_bgr, Scalar(255, 255, 255), 1);

			cv::imshow("result", fore);

			//Rect r_mixed = roi_hsv & roi_bgr;
			//float r_mixed_area = (float)r_mixed.area();
			//float r_hsv_area = (float)roi_hsv.area();
			//float r_bgr_area = (float)roi_bgr.area();
			//float percent_hsv = roi_hsv.area() == 0 ? 0 : r_mixed_area / r_hsv_area;
			//float percent_bgr = roi_bgr.area() == 0 ? 0 : r_mixed_area / r_bgr_area;
			//g_filehandle2 << ","<<percent_hsv << "," << percent_bgr;

			int r_hsv_area = roi_hsv.area() > 0 ? -1 : 0;
			int r_bgr_area = roi_bgr.area() > 0 ? 1 : 0;
			int sum = (r_hsv_area + r_bgr_area);
			g_filehandle2 << "," << sum;

			if (true)
			{
				while (true)
				{
					if (0x1b == cv::waitKey(33))
						break;
				}
			}
			else
			{
				cv::waitKey(1);
			}
		}
		g_filehandle2 << std::endl;

	}
}


